archimate:DataObject.documentation:
betreft de set aan basiskenmerken van objecten in de openbare ruimte waarop verschillende werkzaamheden betrekking kunnen hebben (zoals bereikbaarheidskaarten, vergunningen, incidenten, etc.);
momenteel in wording in het OOV Kernregistratie Objecten.
gegevens: - Aanzicht (wat zijn de basiskenmerken van het object als je er naar kijkt) - Gebruik - Handhaving
